import React from "react";

const Home = () => {
    return (
        <div className="hero">
            <div class="card text-bg-dark border-0">
                <img src="/assets/bg.jpg" class="card-img" alt="background" />
                <div class="card-img-overlay">
                    <div className="container">
                        <h5 class="card-title  display-3 fw-bolder mb-0 ">Card title</h5>
                        <p class="card-text lead fs-2">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Home;
